description:
Sandy is a busy lady, so her assistant, the smoking hot Bridgette handles her schedule and sometimes even more. When Mr. Jones realizes that he cannot book Sandy for a job, he asks the help of her assistant. The blonde bombshell is quick to jump into the role... giving the man what he wants and then some more.

